import './App.css';
import React from "react";
import SomeInformation from "./components/SomeInformation.js";
import DayPlan from "./components/DayPlan.js";
import Person from "./components/Person.js";
import TextAndDateInformation from "./components/TextAndDateInformation.js";
import {Route, BrowserRouter as Router, Link, Routes} from "react-router-dom";
import Users from "./pages/Users";

function MainPage() {
    return (
        <body>
        <head>
            <link rel="preconnect" href="https://fonts.googleapis.com"/>
            <link rel="preconnect" href="https://fonts.gstatic.com" crossOrigin/>
            <link href="https://fonts.googleapis.com/css2?family=Bad+Script&display=swap" rel="stylesheet"/>
        </head>

        <div className="page">

            <div>
                <SomeInformation/>
                <TextAndDateInformation/>
                <DayPlan/>
                <Person/>
            </div>

        </div>
        </body>
    )
}

function UserCheckPage() {
    return (
        <body>
        <head>
            <link rel="preconnect" href="https://fonts.googleapis.com"/>
            <link rel="preconnect" href="https://fonts.gstatic.com" crossOrigin/>
            <link href="https://fonts.googleapis.com/css2?family=Bad+Script&display=swap" rel="stylesheet"/>
        </head>

        <div className="page">

            <div>
                <Users/>
            </div>

        </div>
        </body>
    )
}


function App() {
    return (

        <Router>
            <Routes> {/* Обертываем все Route внутри Routes */}
                <Route path="/" element={<MainPage/>}/>
                <Route path="/users" element={<UserCheckPage/>}/>
            </Routes>
        </Router>

    );
}

export default App;
